import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom';

const logout = () => {

    const navigate=useNavigate();
    
    // useEffect me async await use nahi kar sakte isliye we use promise (then , catch)
    useEffect(()=>{
        fetch('/logout',{
            method:"GET",
            headers:{
                Accept:"application/json", 
                "Content-Type":"application/json"
              },
              credentials:"include"
            }).then((res)=>{
                // navigate('/login');
                if(!res.status != 200){
                    const error=new Error(res.error);
                    throw error;
                }
            }).catch((err)=>{
                console.log(err);
            })        
    });

  return (
    <>
    <div>
      lagout ka page
    </div>
    </>
  )
}

export default logout ;
